// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import './IDID.sol';
import 'openzeppelin-solidity/contracts/access/Ownable.sol';

contract DID is IDID, Ownable {

    // identifier => UserInfo
    mapping(string => UserInfo) public user;

    // identifier => [ Connected ]
    mapping(string => Connected[]) public userApp;

    function register(string memory _identifier, UserInfo memory _userData) public override onlyOwner returns (bool) {

        UserInfo memory userInfo;

        userInfo.name = _userData.name;
        userInfo.birth = _userData.birth;
        userInfo.gender = _userData.gender;
        userInfo.email = _userData.email;

        user[_identifier] = userInfo;

        return true;
    }

    function connectApp(string memory _identifier, string memory _app) public override onlyOwner {

        Connected memory data;

        data.app = _app;
        data.point = 0;

        userApp[_identifier].push(data);
    }

    function disconnectApp(string memory _identifier, string memory _app) public override onlyOwner {
        require(findUserApp(_identifier, _app));

        uint length = userApp[_identifier].length;
        bytes32 compare = keccak256(abi.encodePacked(_app));

        for (uint i = 0; i < length; i++) {
            if (keccak256(abi.encodePacked(userApp[_identifier][i].app)) == compare ) {

                delete userApp[_identifier][i];
            }
        }

    }

    function updateUserInfo(string memory _identifier, UserInfo memory _userData) public override onlyOwner {
        // require(user[_identifier]); 

        UserInfo memory userInfo;

        userInfo.name = _userData.name;
        userInfo.birth = _userData.birth;
        userInfo.gender = _userData.gender;
        userInfo.email = _userData.email;

        user[_identifier] = userInfo;
    }

    function sendPoint() public override {}

    function addPoint(string memory _identifier, string memory _app, uint _point) public override onlyOwner {
        require(findUserApp(_identifier, _app));

        uint length = userApp[_identifier].length;
        bytes32 compare = keccak256(abi.encodePacked(_app));

        for (uint i = 0; i < length; i++) {
            if (keccak256(abi.encodePacked(userApp[_identifier][i].app)) == compare ) {

                userApp[_identifier][i].point = userApp[_identifier][i].point + _point;
            }
        }
    }

    function subtractPoint(string memory _identifier, string memory _app, uint _point) public override onlyOwner {
        require(findUserApp(_identifier, _app));

        uint length = userApp[_identifier].length;
        bytes32 compare = keccak256(abi.encodePacked(_app));

        for (uint i = 0; i < length; i++) {
            if (keccak256(abi.encodePacked(userApp[_identifier][i].app)) == compare ) {

                userApp[_identifier][i].point = userApp[_identifier][i].point - _point;
            }
        }
    }

    function getPoint(string memory _identifier, string memory _app) public override view onlyOwner returns (uint) {
        require(findUserApp(_identifier, _app)); 

        uint length = userApp[_identifier].length;
        bytes32 compare = keccak256(abi.encodePacked(_app));

        for (uint i = 0; i < length; i++) {
            if (keccak256(abi.encodePacked(userApp[_identifier][i].app)) == compare ) {

                return userApp[_identifier][i].point;
            }
        }
    }

    function getUserApps(string memory _identifier) public view override onlyOwner returns (string[] memory) {
        string[] memory appList;

        uint length = userApp[_identifier].length;
        for (uint i = 0; i < length; i++) {
            appList[i] = userApp[_identifier][i].app;
        }

        return appList;
    }

    function findUserApp (string memory _identifier, string memory _app) private view returns (bool) {

        uint length = userApp[_identifier].length;
        bytes32 compare = keccak256(abi.encodePacked(_app));

        for (uint i = 0; i < length; i++) {
            if (keccak256(abi.encodePacked(userApp[_identifier][i].app)) == compare ) {

                return true;
            }
        }

        return false;
    }
}

