IDID.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

interface IDID {

    struct Connected {
        string app;
        uint point;
    }

    struct UserInfo {
        string name;
        string birth;
        string gender;
        string email;
    }

    /* Event */
    event Send(string _identifier);

    /* Function */
    function register(string memory _identifier, UserInfo memory _userData) external returns (bool);

    function connectApp(string memory _identifier, string memory _app) external;

    function disconnectApp(string memory _identifier, string memory _app) external;

    function updateUserInfo(string memory _identifier, UserInfo memory _userData) external;

    function sendPoint() external;

    function addPoint(string memory _identifier, string memory _app, uint _point) external;

    function subtractPoint(string memory _identifier, string memory _app, uint _point) external;

    function getPoint(string memory _identifier, string memory _app) external view returns (uint);

    function getUserApps(string memory _identifier) external view returns (string[] memory);
}

